import Layout from '../components/Layout';
import 'bootstrap/dist/css/bootstrap.min.css';

const Index = () => (
  <Layout>
  <div>
  	<h1>Welcome to J-Sleeve!</h1>
  </div>
  </Layout>
);

export default Index;
